function getCookie(e){var n=null;if(document.cookie&&""!=document.cookie)for(var o=document.cookie.split(";"),t=0;t<o.length;t++){var r=jQuery.trim(o[t]);if(r.substring(0,e.length+1)==e+"="){n=decodeURIComponent(r.substring(e.length+1));break}}return n}function refresh_token(){var e=getCookie("bklogin_csrftoken");return $('input[name="csrfmiddlewaretoken"]').val(e),!0}